import React, {Component} from "react";
import {ApiurlRoles} from '../services/apirest';
import {ApiurlUsers} from '../services/apirest';
import Header from '../template/Header';
import axios from 'axios';

class Editar extends Component{

    state = {
      form :{
        "number": "",
                "validator": "",
                "name": "",
                "birthdate": "",
                "email": "",
                "code": "",
                "namerole": "",
                "last_name": "",
                "second_last_name": "",
        "rol": ""
        
      },
      error: false,
      errorMsg: ""
    }

    manejadorChange = async e => {
      await this.setState({
          form:{
              ...this.state.form,
              [e.target.name]: e.target.value
          }
      })
 }




    componentDidMount(){
        let idUsuario = this.props.match.params.id;
        let url = ApiurlRoles ;
        let url1 = ApiurlUsers +  idUsuario;
        console.log(url1);
      axios.get(url, url1)
      .then( response => {
        this.setState({
          form : {
            number: response.data.user.identification_document.number,
            validator:  response.data.user.identification_document.validator,
            name:  response.data.user.name,
            birthdate:  response.data.user.birthdate,
            email: response.data.user.contact.email,
            code:  response.data.user.role.code,
            namerole:  response.data.user.role.name,
            last_name:  response.data.user.last_name,
            second_last_name: response.data.user.second_last_name,




            rol: response.data.roles
            
          }
        })
        console.log(response.data.roles);
        console.log(response.data.identification_document.number);
       
      });

    }


    render(){
        const form = this.state.form; 

        return(
               
         <React.Fragment>

         <Header/> 
         <br/>
         
         <div className="container">
                    <h3>Editar Usuario </h3>
         </div>
         <form className="form-horizontal ">

         <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Rut</label>
                    <div className="col-md-8">
                        <input className="form-control" name="number" placeholder="number" type="text" 
                        value={form.number}
                        onChange={this.manejadorChange}
                        />
                      </div>
               </div>
                </div>
                
                <br/>

                <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Digito verificador</label>
                    <div className="col-md-4">
                        <input  className="form-control" name="validator" placeholder="validator" type="text"
                        value={form.validator}
                        onChange={this.manejadorChange}

                        />
                      </div>
               </div>
                </div>

                <br/>

                <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Nombre</label>
                    <div className="col-md-10">
                        <input className="form-control" name="name" placeholder="name" type="text"
                        value={form.name}
                        onChange={this.manejadorChange}
                        
                        />
                      </div>
               </div>
                </div>

                <br/>

                <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Apellido Paterno</label>
                    <div className="col-md-10">
                        <input className="form-control" name="last_name" placeholder="last_name" type="text"
                         value={form.last_name}
                        onChange={this.manejadorChange}

                        />
                      </div>
               </div>
                </div>

                <br/>

                <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Apellido Materno</label>
                    <div className="col-md-10">
                        <input className="form-control" name="second_last_name" placeholder="second_last_name" type="text"
                        value={form.second_last_name}
                        onChange={this.manejadorChange}

                        />
                      </div>
               </div>
                </div>

                <br/>

                <div className="row">
                     <div className="col-sm-6">
                    <label className="col-md-2 control-label">Fecha de nacimiento</label>
                    <div className="col-md-8">
                        <input className="form-control" name="birthdate" placeholder="birthdate" type="text"
                        value={form.birthdate}
                        onChange={this.manejadorChange}

                        />
                      </div>
               </div>
                </div>

                <br/>

                <div className="row">
                     <div className="col-sm-6">
                    <label className="col-md-2 control-label">Email</label>
                    <div className="col-md-8">
                        <input className="form-control" name="email" placeholder="email" type="text"
                        value={form.email}
                        onChange={this.manejadorChange}

                        
                        />
                      </div>
               </div>
                </div>









         <div className="row">
                     <div className="col-sm-4">
                    <label className="col-md-2 control-label">Rol</label>
                    <div className="col-md-6">
                    <select className="roles" id="roles" onChange={this.manejadorChange}  >
                    <option id="1" value="ADMIN">ADMIN</option>
                    <option id="2" value="CLIENTE">CLIENTE</option>
                    <option id="3" value="BODEGA">BODEGA</option>
                    <option id="4" value="FINANZA">FINANZA</option>
                    <option id="5" value="COCINA">COCINA</option>

                   
 
                </select>
                      </div>
               </div>
                </div>




          <br/>

              <button type="submit" className="btn btn-primary" style={{ marginRight: "10px" }}>Editar</button>
              <button type="submit" className="btn btn-danger" style={{ marginRight: "10px" }}>Eliminar</button>
              <a className="btn btn-dark" href="/dashboard" >Salir</a>
              

          
          </form>
        </React.Fragment>
        
               
        );
    }

}


export default Editar;
